// Day 5 -- Polymer analysis

let stringInput = """

"""

// - - - - -
// Utilities

// Flip uppercase to lowercase or vice-versa
extension Character {
    func invertCase() -> Character {
        // alas, with internationalization support no simple .isupper() / .toupper() for us!
        let unicodeself = self.unicodeScalars.first!
        if CharacterSet.lowercaseLetters.contains(unicodeself) {
            return String(self).uppercased().first!
        } else if CharacterSet.uppercaseLetters.contains(unicodeself) {
            return String(self).lowercased().first!
        } else {
            return self
        }
    }
}

// Return a string omitting both uppercase and lowercase versions of 'letter'
extension String {
    func without( letter u : Character ) -> String {
        // Return the string 'from' after all instances (uppercase and lowercase)
        // of 'unit' have been removed
        let iu = u.invertCase()
        return self.filter( { ($0 != u) && ($0 != iu) })
    }
}


// - - - - -
// Part 1: Fully-reacted test polymer


func reactPolymer( _ s : String ) -> String {
    // One pass through is suffient, as long as we keep updating our idea of
    // what's on the left side of the interface when reactions occur
    //
    // 'right' and 'left' here refer to the reaction interface of 2 units
    // 'remnant' is the remaining polymer we're building up one unit at a time
    var remnant : String = ""
    for rightletter in s {
        if let leftletter = remnant.last {
            if leftletter == rightletter.invertCase() {
                remnant.removeLast()
            } else {
                remnant.append(rightletter)
            }
        } else {
            remnant.append(rightletter)
        }
    }
    return remnant
}

let fullyreacted = reactPolymer(stringInput)
print("Remnant polymer: \(fullyreacted)")
print("Remnant length = \(fullyreacted.count)  (input length was \(stringInput.count)")


// - - - - -
// Part 2: If we could remove one arbitrary uppercase/lowercase unit, what would
// the shortest possible polymer length be?
//
// Below is a brute-force solution of just trying all the possibilities and taking
// the minimum length result.  If we had to do this often there could be a cleverer way.

func listPossibleUnits( _ s : String ) -> [Character] {
    // List the set of all units (uppercase versions) used in 's'
    var charsused : Set<Character> = []
    
    // Add all uppercase letters to the set.
    for c in s {
        if CharacterSet.uppercaseLetters.contains(c.unicodeScalars.first!) {
            charsused.insert(c)
        }
    }
    // Return the sorted set, representing all unique uppercase letters in the input.
    // Sorting is just for aesthetics.
    return charsused.sorted()
}
