if false {
    // Note that this runs too slowly in a playground -- probably over 10 minutes
    // with the problem input supplied.  Switch this 'false' to 'true and run
    // standalone and it will take < 1sec.
    
    // Get all possible units from our input
    var possible = listPossibleUnits(stringInput)
    
    // Preset first possibile unit as "best"
    var best     = possible.removeFirst()
    var bestremnant = reactPolymer( stringInput.without(letter: best) )
    print("without unit \(best), len=\(bestremnant.count)")
    
    // Now try all the other possible units, looking for anything better
    for c in possible {
        let cremnant = reactPolymer( stringInput.without(letter: c) )
        print("without unit \(c), len=\(cremnant.count)")
        
        if cremnant.count < bestremnant.count {
            best = c
            bestremnant = cremnant
        }
    }
    
    // Print the shortest we found
    print("\nShortest was without \(best), generating fully-reacted length of \(bestremnant.count)")
}


